getIslandPlayers = function(evt){
    if(typeof ika_finder.handlingIframe == 'undefined'){
        ika_finder.handlingIframe = false
    }
    if(!ika_finder.handlingIframe){
        ika_finder.handlingIframe = true;
        if((evt.target.tagName == "td" || evt.target.tagName == "TD") && (typeof evt.target.id == 'string' || evt.target.id.indexOf('isl')!= -1)){
            document.getElementById("ika_finder_loading").style.display = "inline";
            var td = evt.target;
            var islId = td.id.substring(3);
            document.getElementById("ika_finder_iframeDivs").innerHTML = '<iframe src="'+location.href.split('?')[0]+'?view=island&id='+islId+'" style="display:none" onload="ika_finder.IslandIframeHandler(this, '+islId+')"></iframe>'
            var Ptable = document.getElementById('ika_finder_playerMapTable');
            for(i=0;i<Ptable.childNodes.length;i++){
                Ptable.removeChild(Ptable.childNodes[i]);
            }
            var tbody = document.createElement('tbody');
            var tmp = document.createElement('th');
            tmp.innerHTML = ika_finder.language[ika_finder.language.lang].player;
            tbody.appendChild(tmp);
            tmp = document.createElement('th');
            tmp.innerHTML = ika_finder.language[ika_finder.language.lang].clan;
            tbody.appendChild(tmp);
            tmp = document.createElement('th');
            tmp.innerHTML = ika_finder.language[ika_finder.language.lang].city;
            tbody.appendChild(tmp);
            tmp = document.createElement('th');
            tmp.innerHTML = ika_finder.language[ika_finder.language.lang].level;
            tbody.appendChild(tmp);
            //clean player table
            Ptable.appendChild(tbody);
        }
    }
}


addJS('ika_finder.getIslandPlayers = '+getIslandPlayers);

IslandIframeHandler = function(iframe, islId){
    var Ptable = document.getElementById('ika_finder_playerMapTable');
    Ptable = Ptable.getElementsByTagName('tbody')[0];

    var iframeDoc = iframe.contentDocument; //iframe document

    var infos = {};

    var islFeatures = iframeDoc.getElementById('islandfeatures').getElementsByTagName('li'); //li of ul#islandfeatures
    //wood
    infos.wood = ika_finder.language[ika_finder.language.lang].wood+": "+islFeatures[0].className.split('level')[1];
    //ressource of isl
    infos.ressource = ika_finder.language[ika_finder.language.lang][islFeatures[1].className.split(' level')[0]]+": "+islFeatures[1].className.split(' level')[1];
    //it's wonder'
    infos.wonder = islFeatures[2].getElementsByTagName('a')[0].title;
    //put the infos in the header
    document.getElementById('ika_finder_playerMapHeader').innerHTML = ika_finder.language[ika_finder.language.lang].mapTableHeaderClicked+document.getElementById('isl'+islId).title+" ~ "+infos.wood+" ~ "+infos.ressource+" ~ "+infos.wonder;

    //get the cities and add them to the table
    var cities = iframeDoc.getElementById('cities').childNodes; // childNodes of ul of cities
    for(i=0,e=0;i<cities.length;i++){
        if(cities[i].nodeType == 1 && cities[i].className.indexOf(' level') != -1){
            var infosli = cities[i].getElementsByTagName('ul')[0].getElementsByTagName('li'); //infos li in the ul.cityinfos
            infos = {};
            //getting the info
            infos.city = infosli[0].innerHTML.split('</span>')[1];
            infos.level = infosli[1].innerHTML.split('</span>')[1];
            if(infosli[2].getElementsByTagName('a').length != 0){
                infos.player = infosli[2].innerHTML.split('</span>')[1].split('<a')[0];
            }else{
                infos.player = infosli[2].innerHTML.split('</span>')[1]
            }
            if(infosli[4].getElementsByTagName('a').length != 0){
                infos.clan = infosli[4].getElementsByTagName('a')[0].innerHTML;
            }else{
                infos.clan = infosli[4].innerHTML.split('</span>')[1]
            }
            //creating the tds
            for(key in infos){
                tmp = infos[key];
                infos[key] = document.createElement('td');
                infos[key].innerHTML = tmp;
            }
            //creating the tr
            var tr = document.createElement('tr');
            if(e%2 == 1){
                tr.className = 'alt';
            }
            //appending the tds
            tr.appendChild(infos.player);
            tr.appendChild(infos.clan);
            tr.appendChild(infos.city);
            tr.appendChild(infos.level);
            Ptable.appendChild(tr); //appendting the trs
            e++;
        }
    }

    ika_finder.handlingIframe = false;
    document.getElementById("ika_finder_loading").style.display = "none";
}

addJS('ika_finder.IslandIframeHandler = '+IslandIframeHandler);
